import Taro, {useDidShow} from '@tarojs/taro';
import PageLayout from "../../layouts/PageLayout";
import Empty from '../../components/empty/empty';
import {Image, View, Text, Navigator} from "@tarojs/components";
import withLogin from "../../components/login/login";
import NotLogin from "../../components/notlogin";
import IconFont from "../../components/iconfont/index.weapp";
import {useState} from "react";
import request, {SERVICE_WINKT_LIVE_HEADER, SERVICE_WINKT_ORDER_HEADER} from "../../utils/request";


const ManagerCenter = (props) => {
    const {context, checkLogin, headerHeight, isIpx} = props;
    const {userInfo} = context;
    const {memberInfo} = userInfo;
    const [room, setRoom] = useState<any>();
    const [shopStatuses, setShopStatuses] = useState<any>({});
    const [statuses, setStatuses] = useState<any>({});
    const [afterShopStatuses, setAfterShopStatuses] = useState<any>({});
    const [afterStatuses, setAfterStatuses] = useState<any>({});
    const isLogin = checkLogin();

    useDidShow(() => {
        if (isLogin) {
            loadData();
            request.get("wxapp/manager/shop/orders/tips", SERVICE_WINKT_ORDER_HEADER, null, true).then(res=>{
                //设置标签
                let statuses = res.data.data;
                setShopStatuses(statuses);
            });
            request.get("wxapp/manager/subscribe/orders/tips", SERVICE_WINKT_ORDER_HEADER, null, true).then(res=>{
                //设置标签
                let statuses = res.data.data;
                setStatuses(statuses);
            });
            request.get("wxapp/manager/shop/after/orders/tips", SERVICE_WINKT_ORDER_HEADER, null, true).then(res=>{
                //设置标签
                let statuses = res.data.data;
                setAfterShopStatuses(statuses);
            });
            request.get("wxapp/manager/subscribe/after/orders/tips", SERVICE_WINKT_ORDER_HEADER, null, true).then(res=>{
                //设置标签
                let statuses = res.data.data;
                setAfterStatuses(statuses);
            });
        }
    });
    const loadData = () => {
        request.get( "wxapp/manager/live/myroom", SERVICE_WINKT_LIVE_HEADER, null, true).then(res => {
            let detail = res.data.data;
            if(detail) {
                setRoom(detail);
            }
        });
    }


    const doLogin = () => {
        loadData();
    }

    if (!isLogin) {
        return (
            <PageLayout statusBarProps={{title: '管理中心'}}>
                <NotLogin onLogin={doLogin}/>
            </PageLayout>
        );
    }
    let backgroundStyle: any = {};
    backgroundStyle.background = 'url(data:image/png;base64,) no-repeat top center';
    backgroundStyle.backgroundSize = 'contain';
    Taro.setNavigationBarColor({frontColor: '#ffffff', backgroundColor: 'transparent'}).then();
    const imageStyle: any = {
        position: 'absolute',
        left: '2%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        zIndex: 9999,
        width: '50rpx',
        height: '50rpx',
        borderRadius: '100rpx',
        padding: '6rpx',
        background: 'rgba(255,255,255,0.6)',
        boxSizing: 'content-box'
    }
    const goBack = () => {
        Taro.navigateBack().then();
    }
    const scanCheck = () => {
        Taro.scanCode({}).then(res=>{
            if(res.result) {
                Taro.navigateTo({url: res.result}).then();
            }
        }).catch(()=>Taro.showToast({title: '扫码失败', icon: 'error'}).then());
    }
    const scanToSearch = () => {
        Taro.scanCode({}).then(res=>{
            if(res.result) {
                Taro.navigateTo({url: 'goods_list?code=' + res.result}).then();
            }
        }).catch(()=>Taro.showToast({title: '扫码失败', icon: 'error'}).then());
    }
    const scanToSearchSubscribe = () => {
        Taro.scanCode({}).then(res=>{
            if(res.result) {
                Taro.navigateTo({url: 'subscribe_goods_list?code=' + res.result}).then();
            }
        }).catch(()=>Taro.showToast({title: '扫码失败', icon: 'error'}).then());
    }
    return (
        <PageLayout showStatusBar={false} showTabBar={false}>
            <View className="container" style={{paddingLeft: '30rpx', paddingRight: '30rpx', ...backgroundStyle}}>
                <View className="flex align-center justify-center text-lg"
                      style={{background: 'transparent', height: headerHeight, color: 'white', paddingTop: isIpx?50:10}}>
                    <Image style={imageStyle} src="../../assets/images/backPageImg.png" onClick={goBack} />
                    管理中心
                </View>
                {memberInfo && !memberInfo.status && <Empty title="您的账户已经被禁用，无法使用" height={'calc(100vh - 180px)'}/>}
                {memberInfo && memberInfo.status &&
                    <View className="cu-card bg-white shadow-lg radius-lg margin-top">
                        <View className="content flex flex-direction align-center justify-center padding-top-xl padding-bottom-xl">
                            <Image src={memberInfo.avatar} className="cu-avatar round lg"/>
                            <Navigator url={'site'}
                                className="margin-top-sm text-black text-bold">{memberInfo.siteName} - {memberInfo.nickname}</Navigator>
                        </View>
                    </View>
                }
                {memberInfo && memberInfo.status &&
                    <>
                        <View className="cu-list grid col-3 text-green margin-top-xl margin-bottom-xl shadow-lg radius-lg">
                            <View className="cu-item ">
                                <Navigator className="content" url="goods_list" hover-class="none">
                                    <IconFont name={'shangpin'} color={'orange'} size={24} />
                                    <Text className="text-black">商城图书</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item ">
                                <Navigator className="content" url="subscribe_goods_list" hover-class="none">
                                    <IconFont name={'tushuguan'} color={'orange'} size={24} />
                                    <Text className="text-black">借阅图书</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item ">
                                <View onClick={scanToSearch} className="content" hover-class="none">
                                    <IconFont name={'scan'} color={'orange'} size={24} />
                                    <Text className="text-black">商城扫码</Text>
                                </View>
                            </View>
                            <View className="cu-item ">
                                <View onClick={scanToSearchSubscribe} className="content" hover-class="none">
                                    <IconFont name={'scan'} color={'orange'} size={24} />
                                    <Text className="text-black">借阅扫码</Text>
                                </View>
                            </View>
                            <View className="cu-item ">
                                <View onClick={scanCheck} className="content" hover-class="none">
                                    <IconFont name={'scan'} color={'orange'} size={24} />
                                    <Text className="text-black">扫码核销</Text>
                                </View>
                            </View>
                            <View className="cu-item ">
                                <Navigator className="content" url="orders" hover-class="none" style={{position: 'relative'}}>
                                    {shopStatuses['status-1'] && <View className='cu-tag badge'>{shopStatuses['status-1']}</View>}
                                    <View className="cuIcon-newshot text-orange"/>
                                    <Text className="text-black">商城订单</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item ">
                                <Navigator className="content" url="subscribe_orders" hover-class="none" style={{position: 'relative'}}>
                                    {statuses['status-1'] && <View className='cu-tag badge'>{statuses['status-1']}</View>}
                                    <View className="cuIcon-newshotfill text-orange"/>
                                    <Text className="text-black">借阅订单</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item ">
                                <Navigator className="content" url="members" hover-class="none">
                                    <IconFont name={'yonghuziliao'} color={'orange'} size={24} />
                                    <Text className="text-black">门店会员</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item">
                                <Navigator className="content" url="services" hover-class="none" style={{position: 'relative'}}>
                                    {afterShopStatuses['status-1'] && <View className='cu-tag badge'>{afterShopStatuses['status-1']}</View>}
                                    <IconFont name={'shouhou'} color={'orange'} size={24} />
                                    <Text className="text-black">商城售后</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item">
                                <Navigator className="content" url="subscribe_services" hover-class="none" style={{position: 'relative'}}>
                                    {afterStatuses['status-1'] && <View className='cu-tag badge'>{afterStatuses['status-1']}</View>}
                                    <IconFont name={'shouhou'} color={'orange'} size={24} />
                                    <Text className="text-black">图书损坏</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item">
                                <Navigator className="content" url="agent_members" hover-class="none">
                                    <IconFont name={'xiaohai'} color={'orange'} size={24} />
                                    <Text className="text-black">代理下单</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item">
                                <Navigator className="content" url="site_activities" hover-class="none">
                                    <IconFont name={'guize'} color={'orange'} size={24} />
                                    <Text className="text-black">门店活动</Text>
                                </Navigator>
                            </View>
                            <View className="cu-item">
                                <Navigator className="content" url="live_room" hover-class="none">
                                    <IconFont name={'airudiantubiaohuizhi-zhuanqu_zhibojian'} color={'orange'} size={24} />
                                    <Text className="text-black">门店直播间</Text>
                                </Navigator>
                            </View>
                            {room && room.status &&
                                <View className="cu-item">
                                    <Navigator className="content" url="live_history" hover-class="none">
                                        <View className="cuIcon-playfill text-orange"/>
                                        <Text className="text-black">我的直播</Text>
                                    </Navigator>
                                </View>
                            }
                        </View>
                    </>
                }
            </View>
        </PageLayout>
    );
}

export default withLogin(ManagerCenter);
